<script>
const zoom = document.getElementById('zoom');
const zoomVal = document.getElementById('zoomVal');
function applyZoom() {
  const z = parseFloat(zoom.value);
  zoomVal.textContent = z.toFixed(1) + 'x';
  document.querySelectorAll('svg.zoomable').forEach(svg => {
    const base = parseInt(svg.dataset.baseWidth, 10);
    svg.setAttribute('width', Math.round(base * z));
  });
}
zoom.addEventListener('input', applyZoom);
applyZoom();
</script>
